import React, { useEffect, useState } from 'react'
import { IconBack } from '../pages/Repos_url';
import {Box} from '@material-ui/core';
import axios from 'axios'
import { useHistory, useParams } from 'react-router-dom';
import {BackgroundDiv} from '../theme/Tema'

function Starred() {
  const params = useParams().username
  const [starred, setStarred] = useState([])
const history = useHistory()

useEffect(()=>{
  handle_starred()

})

  const handle_starred = () => {
    axios.get(`https://api.github.com/users/${params}/starred`)
      .then((res) => {
        console.log(res.data)
        if(res.data.length === 0){
          alert("não há starred's")
          history.push(`/home/users/${params}`)
        }
       setStarred(res.data)
    
      }).catch((err) => {
        alert(err.messege)

      })
  }
  
  const map_starred = starred.map((starred)=>{
    return(
        <BoxInfoRepo key = {starred.id}>     
       <p id = 'nameRepo'>{starred.name}</p>

     </BoxInfoRepo> 
  
    ) 
 })

  return (
      <BackgroundDiv>
      <Box bgcolor = 'white' height = '100px'>
    <NamePage className = 'iconP'>Starred</NamePage>
    </Box>
    <BoxGrid display= 'flex'>
   {map_starred}
    </BoxGrid>
    <Box display = 'flex'>
        <IconBack src = 'https://cdn4.iconfinder.com/data/icons/ionicons/512/icon-ios7-arrow-left-512.png'>

        </IconBack>
      </Box>
    
  </BackgroundDiv>
    );
  }
  
  export default Starred;
